    public static function randomString()
    {

        srand((double)microtime() * 1000000);
        $has1 = '';
        $adj_num = count(self::$adjectives);
        $wor_num = count(self::$words);
        for ($i = 0; $i < ((rand() % 4) + 3); $i++) {
            $aj_inx  = rand()%$adj_num;
            $wr_inx  = rand()%$wor_num;
            if ($has1) $has1.=' ';
            if (3==rand(0,5)) $has1.=self::$adjectives[$aj_inx];
            if ($has1) $has1.=' ';
            $has1.=self::$words[$wr_inx];
        }
        return $has1;
    }


